CREATE TABLE `journeys` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `from` varchar(30) NOT NULL,
  `destination` varchar(30) NOT NULL,
  `date_create` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `date_start` datetime DEFAULT NULL,
  `date_finish` datetime DEFAULT NULL,
  `progress` float NOT NULL DEFAULT '0',
  `description` text,
  `journey_statuses_id` int(11) NOT NULL,
  `contracts_id` int(11) NOT NULL,
  `creator_id` int(11) NOT NULL,
  `driver_id` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `fk_journeys_employees2_idx` (`driver_id`),
  KEY `fk_journeys_employees1_idx` (`creator_id`),
  KEY `fk_journeys_contracts1_idx` (`contracts_id`),
  KEY `fk_journeys_journey_statuses1_idx` (`journey_statuses_id`),
  FULLTEXT KEY `full_jour` (`description`)
) ENGINE=MyISAM AUTO_INCREMENT=2001 DEFAULT CHARSET=utf8;
