/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `journeys_BEFORE_INSERT` BEFORE INSERT ON `journeys` FOR EACH ROW BEGIN
	IF((SELECT count(*) FROM journey_statuses WHERE journey_statuses.id = NEW.journey_statuses_id) = 0) THEN
		SIGNAL SQLSTATE '45000';
	END IF;
    IF((SELECT count(*) FROM employees WHERE employees.id = NEW.creator_id) = 0) THEN
		SIGNAL SQLSTATE '45000';
	END IF;
    IF((SELECT count(*) FROM contracts WHERE contracts.id = NEW.contracts_id) = 0) THEN
		SIGNAL SQLSTATE '45000';
	END IF;
END */;;
DELIMITER ;
