/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `journeys_BEFORE_UPDATE` BEFORE UPDATE ON `journeys` FOR EACH ROW BEGIN
	IF((SELECT count(*) FROM journey_statuses WHERE journey_statuses.id = NEW.journey_statuses_id) = 0) THEN
		SIGNAL SQLSTATE '45000';
	END IF;
    IF(OLD.creator_id != NEW.creator_id) THEN
		SIGNAL SQLSTATE '45000';
	END IF;
    IF(OLD.contracts_id != NEW.contracts_id) THEN
		SIGNAL SQLSTATE '45000';
	END IF;
    IF(NEW.driver_id IS NOT NULL) THEN
		IF((SELECT count(*) FROM employees WHERE employees.id = NEW.driver_id) = 0) THEN
			SIGNAL SQLSTATE '45000';
		END IF;
	END IF;
END */;;
